# Default in std::default - Rust

```
pub trait Default: Sized {
    // Required method
    fn default() -> Self;
}
```

Expand description

A trait for giving a type a useful default value.

Sometimes, you want to fall back to some kind of default value, and don’t particularly care what it is. This comes up often with `struct`s that define a set of options:

```
struct SomeOptions {
    foo: i32,
    bar: f32,
}
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0Afn+main()+%7B%0A++++%23%5Ballow(dead_code)%5D%0A++++struct+SomeOptions+%7B%0A++++++++foo:+i32,%0A++++++++bar:+f32,%0A++++%7D%0A%7D&edition=2021)

How can we define some default values? You can use `Default`:

```
#[derive(Default)]
struct SomeOptions {
    foo: i32,
    bar: f32,
}

fn main() {
    let options: SomeOptions = Default::default();
}
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0A%23%5Ballow(dead_code)%5D%0A%23%5Bderive(Default)%5D%0Astruct+SomeOptions+%7B%0A++++foo:+i32,%0A++++bar:+f32,%0A%7D%0A%0Afn+main()+%7B%0A++++let+options:+SomeOptions+=+Default::default();%0A%7D&edition=2021)

Now, you get all of the default values. Rust implements `Default` for various primitives types.

If you want to override a particular option, but still retain the other defaults:

```
fn main() {
    let options = SomeOptions { foo: 42, ..Default::default() };
}
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0A%23%5Ballow(dead_code)%5D%0A%23%5Bderive(Default)%5D%0Astruct+SomeOptions+%7B%0A++++foo:+i32,%0A++++bar:+f32,%0A%7D%0Afn+main()+%7B%0A++++let+options+=+SomeOptions+%7B+foo:+42,+..Default::default()+%7D;%0A%7D&edition=2021)

### [§](#derivable)Derivable

This trait can be used with `#[derive]` if all of the type’s fields implement `Default`. When `derive`d, it will use the default value for each field’s type.

#### [§](#enums)`enum`s

When using `#[derive(Default)]` on an `enum`, you need to choose which unit variant will be default. You do this by placing the `#[default]` attribute on the variant.

```
#[derive(Default)]
enum Kind {
    #[default]
    A,
    B,
    C,
}
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0Afn+main()+%7B%0A++++%23%5Bderive(Default)%5D%0A++++enum+Kind+%7B%0A++++++++%23%5Bdefault%5D%0A++++++++A,%0A++++++++B,%0A++++++++C,%0A++++%7D%0A%7D&edition=2021)

You cannot use the `#[default]` attribute on non-unit or non-exhaustive variants.

The `#[default]` attribute was stabilized in Rust 1.62.0.

### [§](#how-can-i-implement-default)How can I implement `Default`?

Provide an implementation for the `default()` method that returns the value of your type that should be the default:

```
enum Kind {
    A,
    B,
    C,
}

impl Default for Kind {
    fn default() -> Self { Kind::A }
}
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0A%23!%5Ballow(dead_code)%5D%0Afn+main()+%7B%0A++++enum+Kind+%7B%0A++++++++A,%0A++++++++B,%0A++++++++C,%0A++++%7D%0A++++%0A++++impl+Default+for+Kind+%7B%0A++++++++fn+default()+-%3E+Self+%7B+Kind::A+%7D%0A++++%7D%0A%7D&edition=2021)

